def flash_window(count=5):
    FLASHW_STOP = 0
    FLASHW_CAPTION = 1
    FLASHW_TRAY = 2
    FLASHW_ALL = 3
    FLASHW_TIMER = 4
    FLASHW_TIMERNOFG = 12

    info = FLASHWINFO(0, hwnd, FLASHW_ALL | FLASHW_TIMERNOFG, count, 0)
    info.cbSize = ctypes.sizeof(info)
    ctypes.windll.user32.FlashWindowEx(ctypes.byref(info))

