def sendMessage(message):    
    global editing
    global editingLabel

    data = {
        "channel": selected_channel,
        "sender": username,
        "message": message
    }

    if editing:
        print(editingLabel, chat_feed.labels.index(editingLabel))
        data["editMessage"] = True
        data["messageNumber"] = chat_feed.labels.index(editingLabel)
        data["newMessage"] = message_input.get()
        data.pop("message") # So that the server doesnt think its a new message

        editing = False
        editingLabel = lastClickedElement

    client.toServer(data, convert=True)

def getMessageText(*args):
    message = message_input.get()

    if len(message) > 200: return

    sendMessage(message)

    message_input.delete(0, tk.END)

def createNewMessage(data):
    sender = data["sender"]
    message = data["message"]
    channel = data["channel"]
    isSystem = data.get("systemMessage", False)
    
    # hyperlinks
    messageParts = [sender]
    splitMessage = message.split(" ")
    for part in splitMessage:
        if re.search(linkRegex, part):
            messageParts.append( [part] )
        else:
            messageParts.append( part )

    chat_feed.add_message(messageParts, systemMessage=isSystem)

    member = data.get("member")
    if isSystem and member and data.get("leaveEvent"):
        if member_labels.get(member) != None:
            member_labels[member].destroy()
            member_labels.pop(member)
        else:
            print(f"{member} left(?) after appearing offline")
    elif isSystem and member and data.get("joinEvent"):
        if member_labels.get(member) != None: return

        member_labels[member] = members_list.add_message(member)


