def onMessage(data):
    channel = data.get("channel", "General")

    if data.get("isMessageHistory"):
        global messageHistoryCache
        global selected_channel

        messageHistoryCache = data

        selected_channel = selected_channel or "General"

        channelHistory = data.get(selected_channel, [])
        membersList = data.get("members", [])

        for channelMessage in channelHistory:
            createNewMessage(channelMessage)

        for member in membersList:
            if member_labels.get(member, None) != None: continue
            member_labels[member] = members_list.add_message(member)

    elif data.get("message"):
        flash_window()

        if channel == selected_channel:
            createNewMessage(data)

        messageHistoryCache[channel].append(data)
        if data["sender"] != username: notif()

    elif data.get("deleteMessage") or data.get("editMessage"):
        index = data["messageNumber"]
        sender = data.get("sender", "")

        index += len(messageHistoryCache[channel])-maxMessages if len(messageHistoryCache[channel]) > maxMessages else 0 

        message = messageHistoryCache[channel][index]

        if message["sender"] == sender:
            if data.get("deleteMessage"):
                messageHistoryCache[channel].pop(index)
            else:
                messageHistoryCache[channel][index]["message"] = data.get("newMessage", "User edited message with nothing.") + " (edited)"
                messageHistoryCache[channel][index]["edited"] = True

            select_channel(selected_channel or "General", overwrite=True)

client.bindConnect(onConnect)
client.bindRecieve(onMessage)

client.init()
